import React from "react";
const SerialPort = require('serialport');

class SerPort extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        ports: []
      }
    };

    componentDidMount() {
      SerialPort.list().then(
          ports => ports.forEach(console.log),
          err => console.error(err)
      );
    }

    componentDidUpdate() {
        SerialPort.list().then(
            ports => ports.forEach(console.log),
            err => console.error(err)
        );
    }

    render() {
      return (
        <div>
          <p>Nothing</p>
        </div>
      );
    }
  }

export default SerPort;
